import React from 'react'

function TeamMenber(props) {
    return (
        <div className = "col-md-4 text-center">
            <div className="card">
                <div className = "card-header"></div>
                <div className = "card-body">
                <h2>{props.name}</h2>
                </div>
            </div>
        </div>
        
    )
}

export default TeamMenber;
